import React from 'react';
import { HashLink as Link } from 'react-router-hash-link';
import {
    NavBarContainer,
    NavigationContainer,
    NavigationButton
} from './navBar.styled'

const NavBar = () => {
    return (
        <NavBarContainer>
            <NavigationContainer>
                <Link to="about"><NavigationButton to="about">About</NavigationButton></Link>
                <NavigationButton to="experience">Experience</NavigationButton>
                <NavigationButton to="publication">Publication</NavigationButton>
                <NavigationButton to="education">Education</NavigationButton>
                <NavigationButton></NavigationButton>
            </NavigationContainer>
        </NavBarContainer>
    )
}

export default NavBar;
